import React, { Component } from "react";

class HomePage extends Component {


    roteSignUp = (e) => {
        this.props.history.push({
            pathname: '/sign-up',
        });
    }

    render() {
        return (
            <div class="background-home-page">

               <h1 class="title-home-page">Central de Erros</h1>
            </div>

        );
    }
}

export default HomePage;
